}

.k-spreadsheet-pane.k-top {
    border-top-width: 0;
}

.k-spreadsheet-pane.k-left {
    border-left-width: 0;

.k-spreadsheet-top-corner {

    box-sizing: border-box;
    position: absolute;
    top: 0;
    left: 0;
    z-index: 10000;
}

.k-spreadsheet-top-corner::after {
    content: "";
    display: block;
    width: 0;
    height: 0;
    overflow: hidden;
    position: absolute;
    bottom: 0;
    right: 0;
    border: 6px solid transparent;
    border-right-color: inherit;
    border-bottom-color: inherit;

.k-spreadsheet-scroller {
    width: 100%;
    height: 100%;
    overflow: scroll;
    position: absolute;

.k-spreadsheet-haxis,
.k-spreadsheet-vaxis {

    border-color: inherit;
    position: absolute;

    left: 0;
}

.k-spreadsheet-vaxis {
    border-width: 0 0 0 1px;
    top: 0;
}

.k-spreadsheet-row-header,
.k-spreadsheet-column-header {
    text-align: center;
    z-index: 100;
}

.k-spreadsheet-row-header > div,
.k-spreadsheet-column-header > div {

    box-sizing: border-box;
    border-width: 0;
    border-style: solid;
    border-color: inherit;
}

.k-spreadsheet-row-header > div::after,
.k-spreadsheet-column-header > div::after {
    content: "";
    border-width: 0;
    border-style: solid;
    border-color: inherit;
    display: none;
    position: absolute;
    top: 0;
    right: 0;
    bottom: 0;
    left: 0;
}

.k-spreadsheet-row-header {
    position: relative;
}

.k-spreadsheet-column-header {
    position: absolute;
}

.k-spreadsheet-row-header > div {
    border-top-width: 1px;
}

.k-spreadsheet-row-header > div:first-child {
    border-top-width: 0;

.k-spreadsheet-column-header > div {

.k-spreadsheet-disabled-mask {

    border-style: solid;
    box-sizing: border-box;
    position: absolute;

.k-spreadsheet .k-spreadsheet-selection-highlight {

    border-style: solid;
    box-sizing: border-box;
    position: absolute;

    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-position: 50% 50%;
    background-size: 100% 100%;
    background-repeat: no-repeat;
    cursor: move;
}

    width: 6px;
    height: 6px;
    border-style: solid;
    border-width: 1px;

    left: 50%;

}

}

    left: 100%;
    top: 50%;
    cursor: ew-resize;
}

    left: 100%;
    top: 100%;
    cursor: nwse-resize;
}

.k-spreadsheet-drawing .k-spreadsheet-drawing-handle.S {
    left: 50%;
    top: 100%;
    cursor: ns-resize;
}

.k-spreadsheet-drawing .k-spreadsheet-drawing-handle.SW {
    left: 0;
    top: 100%;
    cursor: nesw-resize;
}

.k-spreadsheet-drawing .k-spreadsheet-drawing-handle.W {
    left: 0;
    top: 50%;
    cursor: ew-resize;
}

.k-spreadsheet-drawing .k-spreadsheet-drawing-handle.NW {
    left: 0;
    top: 0;
    cursor: nwse-resize;

.k-pivotgrid {
    border-width: 1px;
    border-style: solid;
    box-sizing: content-box;
    font-size: 14px;
    font-family: inherit;
    line-height: 1.4285714286;
    text-align: start;
    vertical-align: top;
    display: grid;
    grid-template-columns: 300px auto;
    grid-template-rows: 75px auto;
    position: relative;
}

.k-pivotgrid table {
    margin: 0;
    width: 100%;
    max-width: none;
    border-width: 0;
    border-color: inherit;
    border-collapse: separate;
    border-spacing: 0;
    outline: 0;
    text-align: inherit;
    empty-cells: show;

.k-pivotgrid tbody,
.k-pivotgrid th,
.k-pivotgrid tr,
.k-pivotgrid td {
    border-color: inherit;
    text-align: inherit;
}
